.store {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  gap: 16px;
  justify-content: space-between;

  @media screen and (min-width: 768px) {
    column-gap: 32px;
    row-gap: 40px;
  }

  @media screen and (min-width: 1280px) {
    column-gap: 32px;
    row-gap: 64px;
  }

  &__box {
    max-width: 216px;

    @media screen and (min-width: 768px) and (max-width: 1279px) {
      max-width: 344px;
    }

    @media screen and (min-width: 1280px) {
      max-width: 600px;
    }
  }

  &__img-title {
    margin-top: 12px;
    margin-bottom: 6px;
    display: flex;
    align-items: center;

    &::after {
      content: '';

      margin-left: 8px;
