        display: none;
      }
    }
  }

  &__span {
    white-space: nowrap;
  }

  &__img-text {
    opacity: 0.6;
    margin: 0px;
  }

  &__button-box {
    display: flex;
    justify-content: center;
    padding-top: 32px;
  }
