sources.sass\\components\\_blog.scss:
@import '../utils/vars';

.blog {
  &-title {
    font-size: 24px;
    line-height: 1.21;
    text-transform: uppercase;
    display: flex;
    align-items: center;
    gap: 14px;

    &::after {
      content: '';
      border-top: 1px solid black;
      display: inline-block;
      vertical-align: middle;
      width: 100%;
    }
  }

  &-list {
    display: flex;
    gap: 16px;
    justify-content: center;
    padding: 0;

    &_element {
      display: flex;
      height: 100%;
      width: 100%;

      &--display {
        display: none;
      }

      &-img {
        display: flex;
        height: 100%;
        width: 100%;
      }
    }
  }

  &-list2 {
    display: flex;
    gap: 25px;
    justify-content: center;
    padding: 0;

    > li {
      cursor: pointer;
    }
  }

  &-p {
    font-size: 18px;
    font-weight: 500;
    line-height: 1.22;
    margin-bottom: 32px;
    text-align: center;
  }

  &-box {
    display: flex;
    justify-content: center;

    &_button {
      background: $btnDefCl;
      border-radius: 38px;
      border: none;
      color: $whiteFontCl;
      cursor: pointer;
      font-size: 18px;
      font-weight: 500;
      height: 40px;
      line-height: 1.33;
      margin-bottom: 60px;
      width: 170px;
    }
  }
}

@media screen and (min-width: 768px) {
  .blog {
    &-title {
      font-size: 44px;
    }

    &-list_element-img {
      max-width: 344px;
      max-height: 398px;
    }
    &-list2_icon {
      width: 61px;
      height: 61px;
    }

    &-p {
      font-size: 32px;
    }

    &-box_button {
      width: 280px;
      height: 64px;
      font-size: 28px;
      line-height: 0.86;
      margin-bottom: 100px;
    }
  }
}

@media screen and (min-width: 1280px) {
  .blog {
    &-list_element {
      &--display {
        display: block;
      }
      &-img {
        max-width: 390px;
        max-height: 421px;
      }
    }
  }
}

sources.sass\\components\\_footer-section.scss:
@import '../utils/vars';

.footer {
  background-color: $darkFontCl;
  height: 389px;

  &-section {
    display: flex;

    padding: 0 16px;
    color: $whiteFontCl;
  }

  &-row {
    margin: 0 auto;
    max-width: 480px;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    margin-top: 72px;
  }

  &-col {
    width: 48%;
    height: 25%;

    &--display {
      display: none;
    }
  }

  &-title {
    font-family: 'Inter', sans-serif;
    font-size: 18px;
    line-height: 1.2;
    display: inline;
  }

  &-list {
    font-style: normal;
    padding: 0;
    width: 100%;
    margin-top: 18px;

    &_icons {
      display: flex;
      gap: 14px;
    }

    &_element {
      font-family: 'Inter', sans-serif;
      font-size: 14px;
      font-weight: 500;
      line-height: 1.21;
      margin-bottom: 12px;

      > a {
        color: $whiteFontCl;
        font-family: 'Inter', sans-serif;
        text-decoration: none;

        > span {
          font-family: 'Inter', sans-serif;
          text-decoration: none;
        }
      }
    }
  }

  &-p {
    font-family: 'Inter', sans-serif;
    font-size: 14px;
    font-weight: 500;
    line-height: 1.21;
    display: inline;
  }
}

@media screen and (min-width: 768px) {
  .footer {
    height: 268px;
    margin: 0 auto;
    &-row {
      max-width: 768px;
      flex-wrap: nowrap;
    }

    &-col {
      width: auto;
    }

    &-list {
      &_element-br {
        display: none;
      }
      &_icons {
        display: block;
        gap: 18px;
      }
    }
  }
}

@media screen and (min-width: 1280px) {
  .footer {
    height: 299px;
    &-row {
      max-width: 1280px;
    }

    &-col--display {
      display: block;
      fill: #fff;
    }
  }
}

sources.sass\\components\\_modal.scss:
@use '../utils/vars' as *;
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}
label {
  display: flex;
  flex-direction: column;
}
.backdrop {
  z-index: 1000;
  transition: visibility 0.4s linear, opacity 0.4s linear;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(0, 0, 0, 0.2);
}
.is-hidden {
  visibility: hidden;
  opacity: 0;
  pointer-events: none;
  &__ .modal {
    transform: translate(-50%, -50%) scale(0);
  }
}
.modalContact {
  padding: 28px 16px;
  position: absolute;
  width: 272px;
  height: 357px;
  background: rgba(255, 255, 255, 1);
  display: block;
  transition: transform 0.3s linear;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%) scale(1);

  &__close {
    cursor: pointer;
    position: absolute;
    right: 16px;
    top: 16px;
    background-color: transparent;
    border: none;
  }
  &__title {
    font-weight: 600;
    font-size: 20px;
    line-height: 1.22;
    margin-bottom: 14px;
  }
  &__content {
    font-weight: 500;
    font-size: 12px;
    line-height: 1.22;
    color: $fontModalGreyCl;
    margin-bottom: 18px;
  }
  &__element {
    font-weight: 500;
    font-size: 10px;
    line-height: 1.22;
    color: $fontModalGreyCl;
  }
  &__input {
    height: 35px;
    border: 1px solid #d7d7d7;
    border-radius: 4px;
    padding: 10px 0 10px 12px;
    outline-style: none;
    margin-top: 8px;
    margin-bottom: 14px;
    color: $fontModalPlaceholder;
  }
  &__button {
    cursor: pointer;
    width: 240px;
    height: 37px;
    background-color: $btnUnactiveCl;
    border: none;
    border-radius: 8px;
    margin-top: 10px;
    color: rgba(255, 255, 255, 1);
    font-weight: 600;
    font-size: 14px;
    line-height: 1.22;
  }
}

@media screen and (min-width: 768px) {
  .modalContact {
    padding: 48px 32px;
    width: 480px;
    height: 511px;
    &__close {
      width: 24px;
      height: 24px;
      top: 24px;
      right: 24px;
    }
    &__title {
      font-size: 32px;
      margin-bottom: 24px;
    }
    &__content {
      font-size: 16px;
      margin-bottom: 32px;
    }
    &__element {
      font-size: 14px;
    }
    &__input {
      height: 49px;
      padding: 16px 0 16px 16px;
      outline-style: none;
      margin-top: 8px;
      margin-bottom: 24px;
      color: $fontModalPlaceholder;
    }
    &__button {
      width: 416px;
      height: 50px;
      margin-top: 14px;
      font-size: 18px;
    }
  }
}

//For now only as input class but maybe we should move it to separate class connected with modal form fields
input:invalid {
  border: red solid 3px;
}

sources.sass\\components\\_modal-window.scss:
@use '../utils/vars' as *;

.is-hidden {
  visibility: hidden;
  pointer-events: none;
  transform: translateX(-50%) translateY(-50%) scale(0);
}

.backdrop {
  background: rgba(0, 0, 0, 0.3);
  width: 100%;
  height: 100%;
  position: fixed;
  top: 0;
  left: 0;
  z-index: 2;
  transition: 0.3s ease;
}

.modal {
  position: absolute;
  top: 50%;
  left: 50%;
  transition-property: visibility, transform;
  transition-duration: 5s;
  transform: translateX(-50%) translateY(-50%) scale(1);
  visibility: visible;
  width: 272px;
  min-height: 358px;
  background-color: $whiteFontCl;

  &__button-close {
    position: absolute;
    top: 14px;
    right: 14px;
    width: 18px;
    height: 18px;
    padding: 0;
    padding-top: 3px;
    border: 0px;
    display: flex;
    justify-content: center;
    background-color: transparent;
  }
  &__button-close-icon {
    fill: rgba(0, 0, 0, 1);
  }
}

.modal-flow {
  display: flex;
  flex-direction: column;
  justify-content: center;
  &__img {
    width: 272px;
    height: 121px;
    & > img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      display: flex;
    }
  }
  &__container {
    padding-top: 18px;
    text-align: center;
    padding-left: 16px;
    padding-right: 16px;
    justify-content: center;
  }
  &__title {
    padding-bottom: 14px;
    margin: 0 auto;
    font-weight: 600;
    font-size: 19px;
    line-height: 1.2;
  }

  &__description {
    margin: 0 auto;
    font-weight: 400;
    font-size: 12px;
    line-height: 1.3;
    color: $fontModalGreyCl;
  }

  &__form {
    padding-top: 18px;
    display: flex;
    flex-direction: column;
    gap: 18px;
    align-items: center;

    &-item {
      display: flex;
      flex-direction: column;
      gap: 8px;
      align-items: flex-start;
    }
    &-title {
      font-weight: 500;
      font-size: 10px;
      line-height: 1.2;
      color: $fontModalGreyCl;
    }
    &-input {
      height: 35px;
      width: 220px;
      outline: none;
      padding-left: 12px;
      border: 1px solid #d7d7d7;
      border-radius: 4px;
      font-weight: 500;
      font-size: 12px;
      line-height: 1.25;
      color: #111111;
      &::placeholder {
        color: rgba(17, 17, 17, 0.4);
      }
      &:hover {
        border-color: rgba(17, 17, 17, 0.7);
      }
      &:valid {
        border-color: $inputCorrectCl;
      }
      &:invalid {
        border-color: $inputErrorCl;
      }
    }
    &-subscribe {
      width: 236px;
      height: 37px;
      background-color: $btnDefCl;
      border-radius: 8px;
      margin-bottom: 28px;
      border: none;
      outline: none;
      &:hover {
        background-color: $btnHoverCl;
      }
      &:focus {
        background-color: $btnFocusCl;
      }
      &-text {
        font-weight: 600;
        font-size: 14px;
        line-height: 1.2;
        color: $whiteFontCl;
      }
    }
  }
}

@media screen and (min-width: 768px) {
  .modal {
    width: 588px;
    height: 644px;
    &__button-close {
      top: 24px;
      right: 24px;
      width: 24px;
      height: 24px;
    }
  }
  .modal-flow {
    &__img {
      width: 588px;
      height: 271px;
    }
    &__container {
      padding-top: 28px;
      text-align: center;
      padding-left: 118px;
      padding-right: 118px;
    }
    &__title {
      padding-bottom: 24px;
      font-size: 28px;
    }
    &__description {
      font-size: 16px;
    }
    &__form {
      padding-top: 28px;
      gap: 28px;

      &-title {
        font-size: 14px;
      }
      &-input {
        height: 49px;
        width: 322px;
        font-size: 14px;
      }
      &-subscribe {
        width: 336px;
        height: 50px;

        margin-bottom: 40px;

        &-text {
          font-size: 18px;
        }
      }
    }
  }
}

@media screen and (min-width: 1280px) {
  .modal {
    width: 860px;
    height: 528px;
  }
  .modal-flow {
    flex-direction: row;
    width: 100%;
    height: 100%;
    &__img {
      width: 428px;
      height: 528px;
    }
    &__container {
      width: 432px;
      padding: 0px;
    }
    &__title {
      padding-top: 111px;
      padding-left: 40px;
      padding-right: 40px;
    }
    &__description {
      padding-left: 48px;
      padding-right: 48px;
    }
  }
}
